import React  from "react";
const MainPage = () => {
    return (
        <div className="centerBox">
            <h1></h1>
        <div className="heading">LegalMind</div>
        <p>Two ways to start!</p>
        <div className="optionButtons">
        <button>Documents</button>
        <button>Chat</button>
        </div>
        </div>
    )
}

export default MainPage;
